import React from 'react';
import {Card} from 'antd';
import {RetweetOutlined} from '@ant-design';

const PostCard = ({post}) => {
    return (
        <div>
            <Card 
                cover={post.images[0] && <PostImages images={post.Images} /> }
                actions={[
                    <RetweetOutlined />,
                    <HeartOutlined />,
                    <MessageOutlined />,
                    <Propover>
                        <EllipsisOutlined />
                    </Propover>
                ]}
            >
                <Image />
                <Content />
                <Buttons></Buttons>
            </Card>
            <CommentForm />
            <Comments/>
        </div>
    );
};

export default PostCard;
